import React from 'react';

const PromotionCard = ({promotion}) =>(
    <div>
        <img src={promotion.imageUrl}/>
        <div> {promotion.title}</div>
        <div>{promotion.price}</div>
        <footer>
            <div>{promotion.comments[0]}</div>
        </footer>
    </div>
)


export default PromotionCard;
